<script src="https://d3js.org/d3.v3.min.js" async></script>
<script src="https://html2canvas.hertzen.com/dist/html2canvas.min.js" sync defer></script>

<script>
    function download(){
        // html2canvas(document.getElementById("infografia-content")).then(function(canvas) {
        //     document.body.appendChild(canvas);
        // });
        document.getElementById("svgInfografia").setAttribute('height',document.getElementById("svgInfografia").clientHeight);
        document.getElementById("svgInfografia").setAttribute('width',document.getElementById("svgInfografia").clientWidth);
        console.log(document.getElementById("svgInfografia").offsetHeight);
        console.log(document.getElementById("svgInfografia").style.height);
        console.log(document.getElementById("svgInfografia").clientWidth);
        html2canvas(document.getElementById("infografia-content"), {
            useCORS: true, allowTaint: true
          }).then(function (canvas) {
            if (navigator.msSaveBlob) {
              console.log('this is IE');
              var URL=window.URL;
              var BlobBuilder = window.MSBlobBuilder;
              navigator.saveBlob=navigator.msSaveBlob;
              var imgBlob = canvas.msToBlob();
              if (BlobBuilder && navigator.saveBlob) {
                var showSave =  function (data, name, mimetype) {
                  var builder = new BlobBuilder();
                  builder.append(data);
                  var blob = builder.getBlob(mimetype||"application/octet-stream");
                  if (!name)
                    name = "Download.bin";
                  navigator.saveBlob(blob, name);
                };
                showSave(imgBlob, 'barchart.png',"image/png");
              }
            } else {
              if ($('#export-image-container').length == 0)
                  $('body').append('<a id="export-image-container" download="barchart.jpg">')
              img = canvas.toDataURL("image/jpeg")
              img = img.replace('data:image/jpeg;base64,', '')
              finalImageSrc = 'data:image/jpeg;base64,' + img
        
              $('#export-image-container').attr('href', finalImageSrc)
              $('#export-image-container')[0].click()
              $('#export-image-container').remove()
              document.getElementById("svgInfografia").removeAttribute('height');
              document.getElementById("svgInfografia").removeAttribute('width');
            }
          });
        
    }
</script>
@endsection 